import React from 'react';
import '../Styles/Navbar.css';

const Navbar = () => {
  return (
    <nav className="topnav">
      <a className="active" href="#home">Home</a>
      <a href="#scroll-to-experience">About Me</a>
      <a href="#portfolio">UI/UX Portfolio</a>
      <a href="#scroll-to-projects">Art</a>
      <a href="#scroll-to-art">Contact Me</a>
    </nav>
  );
};

export default Navbar;
